DROP TABLE IF EXISTS `sys_area`;
CREATE TABLE `sys_area` (
  `id` varchar(50) NOT NULL COMMENT '主键',
  `code` varchar(100) DEFAULT NULL COMMENT '编号',
  `name` varchar(255) DEFAULT NULL COMMENT '名称',
  `fullname` varchar(1000) DEFAULT NULL COMMENT '全称',
  `genre` varchar(100) DEFAULT NULL COMMENT '类型',
  `ordinal` varchar(100) DEFAULT NULL COMMENT '排序',
  `parent_id` varchar(50) DEFAULT NULL COMMENT '父表主键',
  `parent_ids` varchar(1000) DEFAULT NULL COMMENT '父ID集',
  `parent_codes` varchar(1000) DEFAULT NULL COMMENT '父编号集',
  `parent_names` varchar(1000) DEFAULT NULL COMMENT '父名称集',
  `leaf` int(11) DEFAULT NULL COMMENT '是否叶子',
  `grade` int(11) DEFAULT NULL COMMENT '节点等级',
  `memo` varchar(1000) DEFAULT NULL COMMENT '备注',
  `creates` varchar(50) DEFAULT NULL COMMENT '创建机构',
  `creater` varchar(50) DEFAULT NULL COMMENT '创建人员',
  `created` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `modifier` varchar(50) DEFAULT NULL COMMENT '更新人员',
  `modified` bigint(20) DEFAULT NULL COMMENT '更新时间',
  `version` int(11) DEFAULT '0' COMMENT '乐观锁',
  `deletion` tinyint(4) DEFAULT '0' COMMENT '逻辑删除标志',
  `artifical` tinyint(4) DEFAULT '0' COMMENT '是否是人造数据',
  `history` tinyint(4) DEFAULT '0' COMMENT '历史数据',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='区域信息表';

